import React from 'react'
import Button from './Button'

const LIST = ["All","Kapil Sharma","Computer Programming","Routers","Live","Motivation","Gadgets","Body-Building","Cloud Computing"]

const ButtonList = () => {
  return (
    <div className='flex'>
      {LIST.map(item=>{
        return <Button name={item} key={item.to}/>
      })}
    </div>
  )
}

export default ButtonList
